const PtSerifRegular = `@font-face { font-family: 'PT Serif'; font-style: normal; font-weight: 400; src: local('PT Serif'), local('PTSerif-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const PtSerif700 = `@font-face { font-family: 'PT Serif'; font-style: normal; font-weight: 700; src: local('PT Serif Bold'), local('PTSerif-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
const PtSerifItalic = `@font-face { font-family: 'PT Serif'; font-style: italic; font-weight: 400; src: local('PT Serif Italic'), local('PTSerif-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const PtSerif700italic = `@font-face { font-family: 'PT Serif'; font-style: italic; font-weight: 700; src: local('PT Serif Bold Italic'), local('PTSerif-BoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
